window.bookSummaryJSON = "<p><b>Sexy-as-sin, broody, and mysterious, Wes Lancaster is the ultimate billionaire bachelor. But what happens when this hot billionaire bad boy meets his feisty match?</b></p> <p>This collection includes:</p> <p><i>Scoring the Billionaire</i>: Although two of his best friends have settled down, Wes Lancaster is determined not to get sucked into some siren's web. As owner of the New York Mavericks football team and wildly successful BAD restaurant, his lifestyle is full as it is. Well, it was, until Winnie Winslow, the new, sexy, stiletto-wearing team physician trash-talks him in the locker room without batting an eye. Now he can't stop himself from wanting her.</p> <p><i>Scoring Her</i>: Wes and Winnie's love is stronger—and hotter—than ever, but will it lead them to saying \"I do\"? Find out what's next for the happy couple, only this time, they're Bahamas-bound with the hot football players of the New York Mavericks.</p> <p><i>Red, White, &amp; You</i>: City-wide power outages. A failed BBQ at Wes's BAD restaurant. A last-minute escape out of NYC to enjoy July Fourth at Winnie's family's lake house. Several unexpected—and uninvited—guests. Wes and Winnie are about to experience a summer vacation they'll never forget.</p> <p>Contains mature themes.</p>"; 
